import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: "e1", title: "some event" },
  { id: "e2", title: "another event" },
];

function EventsPage() {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_EVENTS.map((evnt) => {
          <li key={evnt.id}>
            <Link to={`/events/${evnt.id}`}>{evnt.title}</Link>
          </li>;
        })}
      </ul>
    </>
  );
}

export default EventsPage;
